import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { title: "Event 1", id: "e1" },
  { title: "Event 2", id: "e2" },
  { title: "Event 3", id: "e3" },
];

const EventsPage = () => {
  return (
    <div
      style={{
        flex: 1,
        flexDirection: "column",
        justifyContent: "space-around",
        height: "100vh",
        width: "100vh",
      }}
    >
      {DUMMY_EVENTS.map((event) => (
        <Link to={event.id}>{event.title}</Link>
      ))}
    </div>
  );
};

export default EventsPage;
